var eli,invisibility,flight;
const pixiApp = new PIXI.Application();
await pixiApp.init({ width: 1280, height: 720 })
document.body.appendChild(pixiApp.canvas);
await createVoteBoard();

async function createVoteBoard(){
    await PIXI.Assets.load('Flight.jpg');
    flight = PIXI.Sprite.from('Flight.jpg');
    flight.width = 400;
    flight.height = 400;
    flight.anchor.set(0.5, 0.5);
    
    await PIXI.Assets.load('Invisibility.jpg');
    invisibility = PIXI.Sprite.from('Invisibility.jpg');
    invisibility.width = 400;
    invisibility.height = 400;
    invisibility.anchor.set(0.5, 0.5);
    
    // await PIXI.Assets.load('EliCircle.png');
    // eli = PIXI.Sprite.from('EliCircle.png');
    // eli.width = 200;
    // eli.height = 200;
    // eli.anchor.set(0.5, 0.5);
    
    pixiApp.stage.addChild(flight);
    pixiApp.stage.addChild(invisibility);
    flight.position.set(pixiApp.renderer.width / 4, pixiApp.renderer.height / 2);
    invisibility.position.set(pixiApp.renderer.width / 4 * 3, pixiApp.renderer.height / 2);
    // invisibility.addChild(eli);
    // eli.position.set(-flight.width,0);
    firebaseSetup();
    //console.log(createSpriteFromImageData(ImageData,"xxyyzz"));
}


